import React, {useState} from "react";
import '../css/RegisterScreen.css'
import ReactDOM from "react-dom";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import RegisterUser from "./RegisterUser";
import RegisterServiceProvider from "./RegisterServiceProvider";

const RegisterScreen = ({Address, Register}) => {

    const [userType, setUserType] = useState();

        return(
            <Router>
                <div>

                        <ul>
                            <li>
                                <Link to ="/void">Please click on the links below</Link>
                            </li>
                            <li>
                                <Link to="/registeruser">User</Link>
                            </li>
                            <li>
                                <Link to = "/registersp">Service Provider</Link>
                            </li>

                        </ul>


                    {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
                    <Switch>
                        <Route path = "/void"><h1>Please click on an option below:</h1></Route>
                        <Route path="/registeruser">
                            <RegisterUser />
                        </Route>
                        <Route paht = "/registersp">
                            <RegisterServiceProvider/>
                        </Route>
                    </Switch>
                </div>
            </Router>
  )
}

export default RegisterScreen
